import React from 'react'

function Todo({ todo, removeTodo, todoComplete }) {
    console.log(todo.completed)
    return (
        <div
            style={{
                display: 'flex',
                alignItems: 'center',
            }}
        >
            <button onClick={() => removeTodo(todo.id)}>X</button>
            <li
                style={{
                    textDecoration: todo.completed.false
                        ? 'line-through'
                        : 'underline',
                }}
            >
                {todo.task}
            </li>

            <input onClick={() => todoComplete(todo.id)} type="checkbox" />
        </div>
    )
}

export default Todo
